import React from 'react';
import AddUser from './Components/Users/AddUser';
import UsersList from './Components/Users/UsersList';

function App() {
  return (
    <div>
      <AddUser/>
      <UsersList users={[{name: 'mau',
                          age: '30'},
                        {
                          name: 'Ana',
                          age: '30'
                        }]}/>
    </div>
  );
}

export default App;
